import '../styles.css';
import ItemCard from './ItemCard';

const Form = () => {

return (
<div className='form-container'>
        <ItemCard/>
    <form className='form-box'>

        <label className='label'>
            Duration:
            <input className='form-input' type="text" name="name" />
        </label>
        <button className='btn' type="submit">Submit</button>
    </form>
</div>
);
};
export default Form;
